import React, { useEffect, useState } from "react"

function Note() {
    const [ header, setHeader ] = useState("Header")
    const [ textBody, setTextBody ] = useState("Text body")

    return (
        <span>
            <input 
                className="note-header"
                value={header}
                onChange={e => setHeader(e.target.value)}
            />
            <br></br>
            <input 
                    className="note-text"
                    value={textBody}
                    onChange={e => setHeader(e.target.value)}
                />
        </span>
    )
}

export default Note
